angular.module('app-module', ['form-validator','bootstrap-modal','jspdf-module','upload-files','block-ui','module-access','notifications-module']).factory('app', function($http,$timeout,$window,validate,bootstrapModal,jspdf,uploadFiles,bui,access) {
	
	function app() {

		var self = this;

		self.startup = function(scope) {
			
			scope.controls.add = true;
			scope.controls.edit = false;					
			
		};

		self.data = function(scope) {
			
			jspdf.init();

			scope.formHolder = {};
			scope.views = {};
			
			scope.controls = {
				btns: {
					ok: true,
					cancel: true
				},
				add: true,
				edit: true,
				ok: true,
				cancel:true
			};
			
			scope.doc = {};
			scope.doc.id = 0;
			scope.doc.particulars = {};
			scope.doc.particulars.data = [];
			scope.doc.particulars.dels = [];
			scope.doc.files = [];
			scope.doc.attachments = [];
			
			scope.docs = [];
			
			scope.offices = [];
			
			scope.document_types = [];		
			
			scope.transactions = [];	
			
			scope.communications = [];		
			
			$http({
				method: 'GET',
				url: 'handlers/communications.php'
			}).then(function mySuccess(response) {
				
				scope.communications = angular.copy(response.data);
					
			}, function myError(response) {
				
		
			});

			$http({
				method: 'GET',
				url: 'handlers/transactions.php'
			}).then(function mySuccess(response) {
				
				scope.transactions = angular.copy(response.data);
					
			}, function myError(response) {
				
		
			});		

			$http({
				method: 'GET',
				url: 'handlers/offices.php'
			}).then(function mySuccess(response) {
				
				scope.offices = angular.copy(response.data);
					
			}, function myError(response) {
				
		
			});				

			$http({
				method: 'GET',
				url: 'handlers/doctype.php'
			}).then(function mySuccess(response) {

				scope.document_types = angular.copy(response.data);
					
			}, function myError(response) {
		
		
			});				
			
			
		};
		
		self.add = function(scope) {
			
			if (!access.has(scope,scope.profile.group,scope.module.id,scope.module.privileges.add)) return;
			
			scope.controls.btns.ok = false;
			scope.controls.btns.cancel = false;
			
			scope.doc = {};
			scope.doc.id = 0;
			scope.doc.particulars = {};			
			scope.doc.particulars.data = [];
			scope.doc.particulars.dels = [];			
			scope.doc.files = [];
			scope.doc.attachments = [];			
			
		};
		
		self.cancel = function(scope) {
			
			scope.controls.btns.ok = true;
			scope.controls.btns.cancel = true;
			
			validate.cancel(scope,'doc');
			
			$timeout(function() {
				if ($routeParams.option==undefined) scope.doc = {};				
			},500);
			
		};
		
		
		self.save = function(scope) {		
		
			uploadFiles.start(scope, function() {				

				/* if (scope.doc.files.length == 0) {
					
					return;
					
				}; */
				
				if (validate.form(scope,'doc')) return;
					
				bui.show();
				
				$http({
				  method: 'POST',
				  url: 'handlers/add-documents.php',
				  data: scope.doc
				}).then(function mySuccess(response) {
					
					scope.doc.barcode = response.data.barcode;
					
					barcode(response.data.barcode);

					scope.controls.btns.ok = true;
					scope.controls.btns.cancel = true;	
					
					bui.hide();
					
					
				}, function myError(response) {
					
					bui.hide();
					
				});				
				
			});
			
		};
		
		self.particulars = {
			
			add: function(scope) {
				
				scope.doc.particulars.data.push({id:0, particular_description: '', disabled: false});
				
			},
			
			edit: function(scope,row) {

				var index = scope.doc.particulars.data.indexOf(row);
				scope.doc.particulars.data[index].disabled = !scope.doc.particulars.data[index].disabled;

			},
			
			del: function(scope,row) {

				if (row.id > 0) {
					scope.doc.particulars.dels.push(row.id);
				}			

				var data = scope.doc.particulars.data;
				var index = scope.doc.particulars.data.indexOf(row);
				scope.doc.particulars.data = [];

				angular.forEach(data, function(d,i) {
					
					if (index != i) {
						
						delete d['$$hashKey'];
						scope.doc.particulars.data.push(d);
						
					};
					
				});
			
			}
			
		};
		
		function barcode(barcode) {		

			JsBarcode("#barcode",barcode, {
			  lineColor: "#000",
			  width: 1,
			  height: 20,
			  displayValue: true
			});				

		};
		
		self.print = function(scope) {

			var doc = new jsPDF({
				orientation: 'portrait',
				unit: 'pt',
				format: [612,792]
			});
			
			doc.setFontSize(8);
			doc.text(456, 27, "Provincial Government of La Union");
			doc.setFontSize(9);
			// doc.myText(497, 39, scope.doc.doc_type.document_type);
			doc.myText(scope.doc.doc_type.document_type,{align: "center"},0,39,true,345);			
			
			var imgData3 = 'data:image/jpeg;base64,'
			
			var barcode = $("#barcode")[0].toDataURL("image/png");
			
			var imgData2 = 'data:image/jpeg;base64,'
			
			doc.addImage(barcode, 'PNG', 440, 39, 150, 45);
			doc.addImage({
				imageData : imgData2,
				angle     : -20,
				x         : 430,
				y         : 13,
				w         : 25,
				h         : 25
			});

			doc.addImage({
				imageData : imgData3,
				angle     : -20,
				x         : 580,
				y         : 15,
				w         : 20,
				h         : 20
			});
			
			var m_names = new Array("January","February","March","April","May","June","July","August","September","October","November","December");

			var today = new Date();
			var curr_date = today.getDate();
			var curr_month = today.getMonth();
			var curr_year = today.getFullYear();
			var curr_hour = today.getHours();
			var curr_min = today.getMinutes();
			var curr_sec = today.getSeconds();

			today = m_names[curr_month] + " " + curr_date + ", " + curr_year + " || " + curr_hour + " : " +	 curr_min + " : " +	 curr_sec;
			var newdat = today;

			doc.setFontType("italic");
			doc.setFontSize(10);

			doc.text(447, 89, newdat);
			
			var blob = doc.output("blob");
			window.open(URL.createObjectURL(blob));				
			
		};
		
		// upload file
		self.addFile = function(scope) {
			
			$('#upload-files')[0].click();
			
		};
		
		// upload attachment
		self.addAttachment = function(scope) {
			
			$('#upload-attachments')[0].click();
			
		};		
		
	};
	
	return new app();
});
